function isStringArray(params: paramsType): params is string[] {
  return typeof params[0] === 'string';
}
function f(a: paramsType) {
  if (isStringArray(a)) {
    return a[0] + ':' + a[1]; // no error but b can be number!
  } else {
    return a[0] + a[1]; // error as b can be number | string
  }
}
